import React from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import './../style/ImageUpload.css';

export default () => {
    // const image = {
    //     backgroundImage:
    //         'url(https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg);',
    // };
    return (
        <Container>
            <Row className='pb-2'>
                <Col>
                    <img alt='img' className='image-placeholder large-holder' />
                </Col>
            </Row>
            <Row className='pb-2'>
                <Col className='pr-1'>
                    <div className='image-placeholder small-holder'>Upload</div>
                </Col>
                <Col className='pl-2'>
                    <div className='image-placeholder small-holder'>Upload</div>
                </Col>
            </Row>
            <Row className='pb-2'>
                <Col className='pr-1'>
                    <div className='image-placeholder small-holder'>Upload</div>
                </Col>
                <Col className='pl-1'>
                    <div className='image-placeholder small-holder'>Upload</div>
                </Col>
            </Row>
        </Container>
    );
};
